Traduzindo para nosso querido português, Stop Loss é “Limite de perda” ou “Parar perda”. 🤓❌⠀
⠀
🔸Mas vamos entender um pouco sobre esse tipo de mecanismo. Stop loss é uma ordem de venda programada para ser executada automaticamente caso o cripto ativo atinja o percentual de perda determinado pelo seu investidor.⠀
Ou seja, imagine que você vá para uma reunião ou algum eventual compromisso e não veja o momento em que ocorre essa queda, seria um provável prejuízo, não é? Logo, para evitar esse tipo de situação que funciona o stop loss.⠀
⠀
👉Quando você cria uma ordem de compra em sua exchange, você pode programar o máximo de perda que está disposto a sofrer, assim se o seu ativo atinge esse valor determinado, o limite de perda se torna uma ordem de mercado, ou seja, será vendido pelo preço de mercado.⠀
⠀
🔹Vale reforçar que infelizmente ainda não são todas as exchanges que realizam essa função, por isso sempre incentivamos uma boa avaliação de opções para escolher qual a Exchange mais dará os suportes necessários.⠀
⠀
