Portanto, o compartilhamento e divulgação de pornografia infantil pela internet é crime!

O conceito de intimidade precisa ser discutido e trabalhado com as crianças. Esta é uma forma preventiva de proteger seus filhos de assédio ou qualquer outro tipo de abuso. Isso sem falar que é uma forma de conscientizar a criança sobre seu corpo e de como cuidar dele.

Para tanto, pensando no processo de aprendizagem sexual, a CDTI indica a webserie da Campanha "Defenda-se" promovida pelo Grupo Marista no YouTube. 

A campanha prevê uma série de 12 vídeos voltados para crianças de 5 a 11 anos, com o objetivo de reduzir os índices alarmantes de abuso e exploração sexual infantil. 

Os vídeos adotam uma linguagem de fácil compreensão, amigável, preventiva e completamente redesenhada, que pode ajudar as crianças a aprenderem a estabelecer os limites das relações com outras crianças e adultos..

As crianças devem saber que seus corpos são invioláveis e protegidos pelo Estado desde cedo. Do mesmo modo, suas imagens.

Oriente seus filhos sobre os limites de seus corpos, seja no contato direto ou virtual. 

O canal direito para estes casos é o Disque 100, em funcionamento 24 horas, além dos conselhos tutelares e delegacias especializadas. Denuncie!

